INSERT INTO `notification_templates` (`id`, `business_id`, `template_for`, `email_body`, `sms_body`, `subject`, `auto_send`, `auto_send_sms`, `created_at`, `updated_at`) VALUES
(1, 1, 'new_sale', '<p>Dear {contact_name},</p>\r\n\r\n<p>Your invoice number is {invoice_number}<br />\r\nTotal amount: {total_amount}<br />\r\nPaid amount: {paid_amount}</p>\r\n\r\n<p>Thank you for shopping with us.</p>\r\n\r\n<p>{business_logo}</p>\r\n\r\n<p>&nbsp;</p>', 'Dear {contact_name}, Thank you for shopping with us. {business_name}', 'Thank you from {business_name}', 1, 0, '2019-01-16 21:02:50', '2022-06-22 02:43:37'),
